  false,\n\t\"url\": null,\n\t\"notes\": \"The FSTopo cartographic database supports
  the creation of 1:24,000-scale, 7.5-minute topographic PDF maps for the conterminous
  United States and Puerto Rico, and 15 minute x 20-22.5 minute, 1:63,360-scale maps
  over Alaska. The FSTopo Area of Interest covers the USFS National Forests and Grasslands.
  The cartographic database is updated accordingly as new data sources are added by
  means of data revision activities, which are coordinated between the National Forest/Grassland
  units and the USFS Geospatial Service and Technology Center (GSTC).\",\n\t\"license_title\":
